"""Proteins are chains of amino acids just as nucleic acids are polymers of nucleotides.
There are 20 amino acids that commonly appear in every species.
Primary structure of proteins is the order of its amino acids.
Some proteins are composed of several subchains called polypeptides, while others are formed of a single polypeptide e.g. Human Hemoglobin molecule has 4 polypeptide chains (2 alpha, 2 beta).

The key to understanding life lies in interpreting the relationship between a chain of amino acids and the function of the protein that this chain of amino acids eventually constructs.
Proteomics is the field devoted to the study of proteins.

translation
messenger RNA (mRNA)
codons
start codon (AUG) - always Met to indicate the start of translation
stop codons (UAA, UAG, UGA)

Central Dogma of Molecular Biology - protein is always created from RNA, which in turn is always created from DNA.
Like all dogmas, it does not always hold; however it offers and excellent approximation of the truth.

ribosome
transfer RNA (tRNA)
anticodon
gene
heredity"""

"""Sample Dataset Problem

The 20 commonly occurring amino acids are abbreviated by using 20 letters from the English alphabet (all letters except for B, J, O, U, X, and Z).
Protein strings are constructed from these 20 symbols.
Henceforth, the term genetic string will incorporate protein strings along with DNA strings and RNA strings.

The RNA codon table dictates the details regarding the encoding of specific codons into the amino acid alphabet.

    Given: An RNA string s corresponding to a strand of mRNA (of length at most 10 kbp).
    Return: The protein string encoded by s."""

s = "AUGGCCAUGGCGCCCAGAACUGAGAUCAAUAGUACCCGUAUUAACGGGUGA"

from DNAToolkit import validateRNASeq, translate_rna

rna_seq = "AUGGCCAUGGCGCCCAGAACUGAGAUCAAUAGUACCCGUAUUAACGGGUGA"
  
print(validateRNASeq(rna_seq))
print(translate_rna(rna_seq))
"""Output: MAMAPRTEINSTRING"""

